import React, { Component } from 'react';

class Header extends Component {
  render() {
    return (
      <nav className="navbar">
        <div className="navbar-brand">
          <a href="#" className="navbar-item">
            Emaily
          </a>
        </div>
      </nav>
    );
  }
}

export default Header;
